description:
Bosch 2609255264 este un burghiu plat pentru perforarea lemnului.
Caracteristici:
diametru - 18 mm;
lungime activa - 110 mm;
lungime totala - 160 mm;
diametrul tijei - 5.5 mm;
cu varf de centrare pentru inceperea precisa a gauririi;
compatibil cu masinile de gaurit cu mandrina automata.

Bosch 2609255232 este un burghiu elicoidal pentru perforarea lemnului.
Caracteristici:
diametru - 8 mm;
lungime activa - 170 mm;
lungime totala - 235 mm;
diametrul tijei - 6.5 mm;
avans mare de gaurire si eliminare rapida a aschiilor datorita geometriei optimizate;
compatibil cu masinile de gaurit cu mandrina automata.

Burghiul pentru lemn Blue Groove are dimensiunile 6 x 25 mm, cu lungimea de 165 mm si prindere 1/4 inch. Acesta este construit cu un design Tri-Flute pentru o evacuare mai usoara a rumegusului si varf tip surub pentru utilizare usoara si eliberare rapida dupa executarea gauririi.
Caracteristici:
muchiile taietoare sunt concepute pentru gauri curate si permit efectuarea gaurilor si prin lemne cu cuie;
este tratat in intregime, pentru extra durabilitate;
conceput pentru a incapea intre stalpi;
prevazut cu o coada hexagonala Quick Change de 1/4”.

Makita D-30106 este un set mixt care include 5 burghie cu coada cilindrica pentru gaurirea lemnului si a metalelor cu ajutorul masinilor de gaurit.
Setul include:
2 burghie pentru lemn, cu diametrele de 6 si 8 mm;
3 burghie pentru metal, cu diametrele de 5, 6 8 mm;
cutie din plastic pentru depozitare.

Bosch 2609255201 este un burghiu elicoidal pentru perforarea lemnului.
Caracteristici:
diametru - 4 mm;
lungime activa - 45 mm;
lungime totala - 75 mm;
diametrul tijei - 4 mm;
cu varf de centrare pentru inceperea precisa a gauririi;
compatibil cu masinile de gaurit cu mandrina automata.

Setul Tivoly 10863870018 va ajuta la realizarea gaurilor in lemn. Acest set include 5 burghie profesionale din otel, cu 3 varfuri gradate, destinate folosirii impreuna cu masinile de gaurit stationare sau portabile, electrice sau pneumatice.
Burghiele sunt organizate si depozitate intr-o cutie din plastic si au urmatoarele dimensiuni: 3, 4, 5, 6 si 8 mm.
Setul include:
1 burghiu cu dimensiunea 3 x 30 x 62 mm;
1 burghiu cu dimensiunea 4 x 40 x 76 mm;
1 burghiu cu dimensiunea 5 x 50 x 87 mm;
1 burghiu cu dimensiunea 6 x 55 x 92 mm;
1 burghiu cu dimensiunea 8 x 75 x 118 mm.

